import React from 'react';
//import logo from './logo.svg';
import './App.css';
import './Mobile.css';

function App() {
  return (
    <div className="container-fluid">
      <nav class="navbar fixed-top navbar-dark bg-dark">
        <div class="container-fluid">
          <a href="http://localhost:3000" class="navbar-brand">
              brand
          </a>
          <button id="brand" class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarToggleExternalContent" aria-controls="navbarToggleExternalContent" aria-expanded="false" aria-label="Toggle navigation">
            <span class="navbar-toggler-icon"></span>
          </button>
          <div class="collapse navbar-collapse">
              <ul class="navbar-nav nav">
                  <li class="active"><a href="#">首页</a></li>
                  <li><a href="#">新闻</a></li>
                  <li><a href="#">国内</a></li>
                  <li><a href="#">国际</a></li>
              </ul>

          </div>
        </div>
      </nav>

      <div class="row">
        <div class="col">
          One of three columns
        </div>
        <div class="col-8">
          One of three columns
        </div>
      </div>
      {/* <!--img src={logo}
            data-src-600px="image-600px.jpg"
            data-src-800px="image-800px.jpg"
            alt=""></img--> */}

    </div>

  );
}

export default App;
